import logo from './logo.svg';
import './App.css';
import * as React from 'react';
import ReactDOM from 'react-dom';
import Button from '@mui/material/Button';
import { TextField } from '@mui/material';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <TextField
          id="outlined-number"
          label="Number"
          type="number"
          InputLabelProps={{
            shrink: true,
          }}
        />
      </header>
    </div>
  );
}

export default App;
